(1,'X_MASTER_X','Profil','Y','<p><b>Komputeclift </b>Bergerak dibidang pembuatan LIFT BARANG, DUMBWAITER,PASSANGER</p><p>Dengan berkembangnya teknologi dan pesatnya pembangunan dan sangat diperlukannya efisiensi dalam bekerja terutama efisiensi waktu dalam bisnis anda, maka kami Komputeclift Hadir untuk menjawab solusi yang Bapak / Ibu hadapi, dengan menyediakan beberapa keunggulan yang akan berguna untuk kenyamanan dan keamanan bagi para customer.</p><div><br></div>',NULL,'2015-01-18','14:50:00',NULL,1),
(2,'box_profile','Keunggulan','Y','<b style=\"background-color: initial;\">KEUNGGULAN YANG DIMILIKI KOMPUTECLIFT</b><br><span style=\"background-color: initial;\"><br></span><div><span style=\"background-color: initial;\">1.</span><span class=\"Apple-tab-span\" style=\"white-space: pre; background-color: initial;\">	</span><span style=\"background-color: initial;\">Ukuran LIFT disesuaikan dengan lubang LIFT yang ada (menyesuaikan HOISTWAY)&nbsp;</span><br><span style=\"background-color: initial;\">2.</span><span class=\"Apple-tab-span\" style=\"white-space: pre; background-color: initial;\">	</span><span style=\"background-color: initial;\">Interior sesuai permintaan</span><br><span style=\"background-color: initial;\">3.</span><span class=\"Apple-tab-span\" style=\"white-space: pre; background-color: initial;\">	</span><span style=\"background-color: initial;\">Arrival Buzzer, Gong dan Sound</span><br><span style=\"background-color: initial;\">4.</span><span class=\"Apple-tab-span\" style=\"white-space: pre; background-color: initial;\">	</span><span style=\"background-color: initial;\">Harga Ekonomis tentunya dengan kwalitas yang bagus&nbsp;</span><div><span style=\"background-color: initial;\">5.</span><span class=\"Apple-tab-span\" style=\"white-space: pre; background-color: initial;\">	</span><span style=\"background-color: initial;\">Kami menyediakan jasa kontrak service ( survey terlebih dahulu)</span></div></div>',NULL,NULL,NULL,NULL,1),
(1,'MENU1',NULL,'Y','CV  Computeclift siap melayani pengadaan & pemasangan Lift / Elevator ataupun Eskalator serta pelayanan purna jual untuk Proyek Gedung, Ruko, Perkantoran, Mall, Trade Centre, maupun Rumah tinggal. ',NULL,NULL,NULL,NULL,1),
(1,'box_profile','Profil','Y','<div><b>Komputeclift </b>Bergerak dibidang pembuatan LIFT BARANG, DUMBWAITER,PASSANGER</div><div><br></div><div>Dengan berkembangnya teknologi dan pesatnya pembangunan dan sangat diperlukannya efisiensi dalam bekerja terutama efisiensi waktu dalam bisnis anda, maka kami <b>Komputeclift </b>Hadir untuk menjawab solusi yang Bapak / Ibu hadapi, dengan menyediakan beberapa keunggulan yang akan berguna untuk kenyamanan dan keamanan bagi para customer.</div>',NULL,NULL,NULL,NULL,1),
(1,'CNT','Hubungi Kami','Y','<b>Komputeclift </b>adalah perusahaan yang bergerak di bidang kontruksi pembuatan elevator dan lift barang baik lokal ataupun import, dengan desain sesuai kondisi tempat dan keinginan konsumen. Hubungi kami melalui form berikut untuk mendapatkan informasi detail produk/ jasa yang kami tawarkan.',NULL,NULL,NULL,NULL,1),
(1,'PROY','Proyek Kami','Y',NULL,NULL,NULL,NULL,NULL,1),
(1,'MENU2',NULL,'Y','Dengan didukung oleh tenaga ahli , terampil dan terlatih dibidangnya serta dukungan manajemen yang solid , kami siap melayani konsumen secara professional dan terpercaya.',NULL,NULL,NULL,NULL,1),
(1,'GOOGLE','Google Description','Y','Kontraktor Lift / Elevator / Eskalator Di Bogor Indonesia, Kami melayani penjualan dan service lift / elevator, eskalator, Panel Kontrol juga Maintenance lift serta penggantian suku cadang dan kelistrikannya',NULL,NULL,NULL,NULL,1);
